import "./style.css";
import Editor from "./components/editor";
import Navbar from "./components/Navbar";
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";
function App() {
  return (
    <Router>
      <>
        <Navbar />
        <Switch>
          <Route path="/editor">
            <Editor />
          </Route>
        </Switch>
      </>
    </Router>
  );
}

export default App;
